import React, { Component } from 'react';

class NavigationSubCategoryLink extends Component {
  render() {
    const { name } = this.props;
    return (
      <div className="navigationSubCategory" id={name}>
        {name}
      </div>
    );
  }
}
export default NavigationSubCategoryLink;
